import React from 'react';

const Parent = () => (
  <div>
    <p>Child 1</p>
    <p>Child 2</p>
  </div>
);

const FiberArchitecture = () => {
  const parentString = "<Parent/>";
  return (
    <div>
      <h2>Fiber Architecture:</h2>
      {console.log("Parent Fiber", (<Parent />)._owner)}
      {console.log("Parent of Parent Fiber", (<Parent />)._owner.return)}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
        }}
        className="card"
      >
        <div>
          <p>Parent of {parentString}:</p>
          <p>{parentString}:</p>
          <p>Child 1: </p>
          <p>Child 2:</p>
        </div>

        <div>
          <p>{parentString}._owner.return</p>
          <p>{parentString}._owner</p>
          <p>{parentString}._owner.child</p>
          <p>{parentString}._owner.child</p>
        </div>
      </div>
    </div>
  );
};

export default FiberArchitecture;
